package com.alia.tools.entity;/** * Created by Alia on 2016/12/17. */public class MockServiceInfoDTO {    private String interfaceName;    private String version;    private Integer timeout;    public MockServiceInfoDTO(String interfaceName, String version, Integer timeout) {        this.interfaceName = interfaceName;        this.version = version;        this.timeout = timeout;    }    public String getInterfaceName() {        return this.interfaceName;    }    public String getVersion() {        return this.version;    }    public Integer getTimeout() {        return this.timeout;    }}